response.about:
Я могу быть и пушистой; я могу быть и колючкой; 
 Солнцем ярким, золотистым; молчаливой, хмурой тучкой. 
 Я могу быть гордой розой, и уступчивой фиалкой; 
 Умной, глупой, несерьёзной; поражать своей смекалкой. 

 Я могу перечить сердцу - не ослушаться рассудка; 
 А могу не испугаться очень смелого поступка. 
 Я могу хранить молчание или выболтать всё сразу. 
 Не обидеть злым ответом; вдруг обрадовать отказом. 

 Я могу быть непослушной; я могу быть терпеливой; 
 Доброй, ласковой и нужной, и спокойной, и болтливой. 
 Но какой бы ни была я, быть хочу тобой - Любимой. 
 А в глазах и в сердце нежном - Самой милой и красивой.
